import React from 'react';

function randomName() {
  const names = [
    "George",
    "Rosa",
    "Alexander",
    "Amelia",
    "Winston",
    "Cleopatra",
    "Abraham",
    "Marilyn",
    "Nelson",
    "Leonardo",
    "Joan",
    "Albert",
    "Marie",
    "Martin",
    "Elizabeth",
    "Thomas",
    "Florence",
    "William",
    "Mahatma",
    "Genghis",
  ];

  return names[Math.floor(Math.random() * names.length)];
}

const RandomNames = () => {
  const name = randomName();
};

export default RandomNames;
